const textstyle={color:'white',
marginTop:'10px',
marginLeft:'20px',
marginRight:'20px',
fontSize: '25px',
fontFamily: "Times New Roman Times serif"

}



const MyNavbar = () => {
  const[openModal, setOpenModal] = useState(false);
  const closeModal = ()=>setOpenModal(false);

  return (
    <div style={{ backgroundColor: "#8533ff", height: "70px" , color:'white'}}>

    <Nav defaultActiveKey="/home" as="ul">
    <Nav.Item as="li">
        <Nav.Link style={textstyle}>Home</Nav.Link>
      </Nav.Item>
      <Nav.Item as="li">
        <Nav.Link style={textstyle} href = '/'>Complaint Punch</Nav.Link>
      </Nav.Item>
      <Nav.Item as="li">
        <Nav.Link style={textstyle} >Link</Nav.Link>
      </Nav.Item>
      <Nav.Item as="li">
        <Nav.Link  style={textstyle}>Link</Nav.Link>
      </Nav.Item>
      <span style={{marginLeft:'710px'}}>
      <h5>{<CallIcon/>} 899352666</h5>
      <h5>{<MailIcon/>} crm@gmail.com</h5>
      </span>
    </Nav>
    <div>
     <Button variant="outline-primary" onClick={()=>setOpenModal(true)}>open Modal</Button> 
     {openModal && <MyModal closeModal = {closeModal}/>}
  </div>

    
    </div>
  );
}


export default MyNavbar
